import logo from './logo.svg';
import './App.css';
import AdminNavbar from "./components/navbar";
import VerticalBar from './components/graphs'
import { Container, Row, Col , Card} from "react-bootstrap";
import Dashboard from './components/graphs'


function App() {
  return (
    <div className="App">
          <AdminNavbar />
          <Container fluid>

  <Row md={4} style={{margin:'10px'}}>
    <Col  md={7} style={{background: '#FFFFFF 0% 0% no-repeat',boxShadow: '0px 3px 6px #00000029',borderRadius: '6px',margin:'0px'}}>   
    <Card.Title style={{float: 'left',margin: '10px'}}>Day wise Usage</Card.Title>
  <VerticalBar /></Col>
    <Col  md={1} className='box'></Col>
    <Col md={5}  style={{background: '#FFFFFF 0% 0% no-repeat',boxShadow: '0px 3px 6px #00000029',borderRadius: '6px',margin:'0px'}}>  <VerticalBar /></Col>
  </Row>
</Container>
    </div>
  );
}

export default App;
